ISLAMABAD, Jul 29 (APP):Members of the National Assembly belonging to Pakistan Tehreek-i-Insaf (PTI) Malik Muhammad Amir Dogar and Malik Muhammad Ehsanullah Tiwana Wednesday separately called on Prime Minister Imran Khan, according to PM office media wing.
During the meeting, they discussed matters pertaining to legislation and their respective constituencies.
